  [],\n\t\"title\": \"Unpublished Digital Surficial Geologic Map of Mesa Verde National
  Park and Vicinity, Colorado (NPS, GRD, GRI, MEVE, MVSR digital map) adapted from
  a U.S. Geological Survey Scientific Investigations map by Carrara (2012)\",\n\t\"tracking_summary\":
