  [],\n\t\"revision_timestamp\": \"2013-03-15T10:23:07.708956\",\n\t\"name\": \"unpublished-digital-surficial-geologic-map-of-mesa-verde-national-park-and-vicinity-colora-2012\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Unpublished Digital Surficial Geologic
  Map of Mesa Verde National Park and Vicinity, Colorado is composed of GIS data layers
  complete with ArcMap 9.3 layer (.LYR) files, two ancillary GIS tables, a Map PDF
  document with ancillary map text, figures and tables, a FGDC metadata record and
  a 9.3 ArcMap (.MXD) Document that displays the digital map in 9.3 ArcGIS. Presently,
  a GRI Google Earth KMZ/KML product doesn't exist for this map. The data were completed
  as a component of the Geologic Resources Inventory (GRI) program, a National Park
  Service (NPS) Inventory and Monitoring (I&M) Division funded program that is administered
  by the NPS Geologic Resources Division (GRD). Source geologic maps and data used
  to complete this GRI digital dataset were provided by the following: U.S. Geological
  Survey. Detailed information concerning the sources used and their contribution
  the GRI product are listed in the Source Citation section(s) of this metadata record
  (mvsr_metadata_faq.html; available at http://nrdata.nps.gov/geology/gri_data/gis/meve/mvsr_metadata_faq.html).
  Users of this data are cautioned about the locational accuracy of features within
  this dataset. Based on the source map scale of 1:24,000 and United States National
  Map Accuracy Standards features are within (horizontally) 12.2 meters or 40 feet
  of their actual location as presented by this dataset. Users of this data should
  thus not assume the location of features is exactly where they are portrayed in
  ArcGIS or other software used to display this dataset. All GIS and ancillary tables
  were produced as per the NPS GRI Geology-GIS Geodatabase Data Model v. 2.1. (available
  at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
  The GIS data is available as a 9.3 personal geodatabase (mvsr_geology.mdb), and
  as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
  UTM Zone 12N. The data is within the area of interest of Mesa Verde National Park.\",\n\t\"license_title\":
